-- Adds further world/sector data to the traveller database
-- Version 1.0


-- The subsector table contains information about a Subsector in relation to a sector
-- The lang_id field indicates the language of the subsector name.
--
-- CREATE TABLE "subsector" (
-- 	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
-- 	"name"	TEXT NOT NULL,
-- 	"lang_id"	INTEGER NOT NULL,
-- 	"sector_id"	INTEGER NOT NULL,
-- 	"sector_index"	TEXT NOT NULL,
-- 	"capital_id"	INTEGER,
-- 	"remarks"	TEXT
-- );

-- The world table contains detail about the worlds in charted space. Most of the
-- fields are text and copied straight from the world profile.
--
-- CREATE TABLE "world" (
-- 	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
-- 	"sector_id"	INTEGER NOT NULL,
-- 	"subsector_index"	TEXT NOT NULL,
-- 	"hex"	TEXT NOT NULL,
-- 	"name"	TEXT NOT NULL,
-- 	"UWP"	TEXT NOT NULL,
-- 	"bases"	TEXT,
-- 	"remarks"	TEXT,
-- 	"zone"	TEXT,
-- 	"PBG"	TEXT,
-- 	"allegiance"	TEXT,
-- 	"stars"	TEXT,
-- 	"importance"	TEXT,
-- 	"economics"	TEXT,
-- 	"culture"	TEXT,
-- 	"nobility"	TEXT,
-- 	"worlds"	INTEGER,
-- 	"RU"	INTEGER
-- );

