-- Hunt for Subsector capitals in the world data
SELECT subsector.id, subsector.name, subsector.sector_index, subsector.capital_id, world.id, world.name 
  FROM subsector,world
  WHERE 
	world.sector_id=38 AND subsector.sector_id=38 AND world.subsector_index = subsector.sector_index AND world.remarks LIKE '%Cp%'

-- Update the Aslan race with Homeworld data
UPDATE race
SET homeworld = "Kusyu", homeworld_id = 
	(SELECT world.id FROM world WHERE world.name = "Kusyu")
WHERE race.race_name = "Aslan";

-- Update the subsector data with Capital data
UPDATE subsector
SET capital_id = (
	SELECT id FROM world 
		WHERE world.sector_id=38 AND world.remarks like '%Cp%' AND world.subsector_index=subsector.sector_index);

-- Missing the sector Capital
-- This is a bit of a ham-fisted fix.
UPDATE subsector
SET capital_id = (SELECT world.id from world where name like '%Kusyu')
WHERE sector_id=38 AND sector_index = "J";

