-- Hunt for Subsector capitals in the world data
SELECT subsector.id, subsector.name, subsector.sector_index, subsector.capital_id, world.id, world.name 
  FROM subsector,world
  WHERE 
	world.sector_id=253 AND 
	subsector.sector_id=253 AND 
	world.subsector_index = subsector.sector_index AND 
	world.remarks LIKE '%Cp%';

-- Update the Vargr race with Homeworld data
UPDATE race
SET homeworld_id = 
	(SELECT world.id FROM world WHERE world.name = "Zhdant")
WHERE race.race_name = "Zhodani";

-- Update the subsector data with Capital data
UPDATE subsector
SET capital_id = (
	SELECT id FROM world 
		WHERE 
			world.sector_id=253 AND 
			world.remarks like '%Cp%' 
			AND world.subsector_index=subsector.sector_index
	);

-- Missing the sector Capital
-- This is a bit of a ham-fisted fix.
UPDATE subsector
SET capital_id = (SELECT world.id from world where name like '%Zhdant%')
WHERE sector_id=253 AND sector_index = "H";

-- To assist automated collection of world data form traveller.com

-- world_staging is used to "temporarily" hold world data retrieved from traveller.com. 
-- Data is this table should be checked and then copied across to the world table.
CREATE TABLE "world_staging" (
	"id"	INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
	"sector_code"	TEXT,
	"subsector_index"	TEXT NOT NULL,
	"hex"	TEXT NOT NULL,
	"name"	TEXT NOT NULL,
	"UWP"	TEXT NOT NULL,
	"bases"	TEXT,
	"remarks"	TEXT,
	"zone"	TEXT,
	"PBG"	TEXT,
	"allegiance"	TEXT,
	"stars"	TEXT,
	"importance"	TEXT,
	"economics"	TEXT,
	"culture"	TEXT,
	"nobility"	TEXT,
	"worlds"	INTEGER,
	"RU"	INTEGER,
	"sector_id"	INTEGER
)

-- Discovered there are duplicates in the sector table (in terms of abbreviations)
SELECT abbreviation, count(*)
FROM sector
GROUP BY abbreviation
HAVING COUNT(*) > 1;

-- Add a column to cater for Sectors that are not detailed enough.
ALTER TABLE sector
  ADD COLUMN is_detailed INTEGER NOT NULL DEFAULT 0;

-- Fix table for sectors already retrieved
UPDATE sector SET is_detailed = 1 WHERE id IN (SELECT id FROM sector WHERE id IN (SELECT DISTINCT sector_id FROM world));

